('node', 'annotation', 0, 6, 6, 'und', 0, '<p>xx</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 8, 8, 'und', 0, '<p>知识图谱（Knowledge Graph），在图书情报界称为知识域可视化或知识领域映射地图，是显示知识发展进程与结构关系的一系列各种不同的图形，用可视化技术描述知识资源及其载体，挖掘、分析、构建、绘制和显示知识及它们之间的相互联系。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 9, 9, 'und', 0, '<p>NICE</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 15, 15, 'und', 0, '<p>123</p>\n', NULL, 'filtered_html'),
