('node', 'annotation', 0, 122, 122, 'und', 0, '<p>路由器是连接两个或多个网络的硬件设备，在网络间起网关的作用，是读取每一个数据包中的地址然后决定如何传送的专用智能性的网络设备。它能够理解不同的协议，例如某个局域网使用的以太网协议，因特网使用的TCP/IP协议。这样，路由器可以分析各种不同类型网络传来的数据包的目的地址，把非TCP/IP网络的地址转换成TCP/IP地址，或者反之；再根据选定的路由算法把各数据包按最佳路线传送到指定位置。所以路由器可以把非TCP/ IP网络连接到因特网上。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 123, 123, 'und', 0, '<p>研究，读音，汉语词语，意思是主动寻求根本性原因与更高可靠性依据，从而为提高事业或功利的可靠性和稳健性而做的工作。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 124, 124, 'und', 0, '<p>路由（routing）是指分组从源到目的地时，决定端到端路径的网络范围的进程[1]。路由工作在OSI参考模型第三层——网络层的数据包转发设备。路由器通过转发数据包来实现网络互连。虽然路由器可以支持多种协议（如TCP/IP、IPX/SPX、AppleTalk等协议），但是在我国绝大多数路由器运行TCP/IP协议。路由器通常连接两个或多个由IP子网或点到点协议标识的逻辑端口，至少拥有1个物理端口。路由器根据收到数据包中的网络层地址以及路由器内部维护的路由表决定输出端口以及下一跳地址，并且重写链路层数据包头实现转发数据包。路由器通过动态维护路由表来反映当前的网络拓扑，并通过网络上其他路由器交换路由和链路信息来维护路由表。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 125, 125, 'und', 0, '<p>交叉开关是超级计算机中的一种技术，在向量处理系统（Parallel Vector Processing，PVP）中为向量处理器分配内存的一种技术。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 126, 126, 'und', 0, '<p>部件（assembly unit）是系统的一部分，由若干构件装配在一起的、所组成。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 127, 127, 'und', 0, '<p>方法是一个汉语词汇，方法的含义较广泛，一般是指为获得某种东西或达到某种目的而采取的手段与行为方式。方法在哲学，科学及生活中有着不同的解释与定义。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 128, 128, 'und', 0, '<p>实现是一个汉语词汇，拼音是shíxiàn，指事件或状态的发生，是实现哲学的基础概念；指使成为现实。语出老舍《骆驼祥子》十六：“假若这个主意能实现，他算是又拉上了自己的车。”</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 129, 129, 'und', 0, '<p>算法（Algorithm）是指解题方案的准确而完整的描述，是一系列解决问题的清晰指令，算法代表着用系统的方法描述解决问题的策略机制。也就是说，能够对一定规范的输入，在有限时间内获得所要求的输出。如果一个算法有缺陷，或不适合于某个问题，执行这个算法将不会解决这个问题。不同的算法可能用不同的时间、空间或效率来完成同样的任务。一个算法的优劣可以用空间复杂度与时间复杂度来衡量。算法中的指令描述的是一个计算，当其运行时能从一个初始状态和（可能为空的）初始输入开始，经过一系列有限而清晰定义的状态，最终产生输出并停止于一个终态。一个状态到另一个状态的转移不一定是确定的。随机化算法在内的一些算法，包含了一些随机输入。形式化算法的概念部分源自尝试解决希尔伯特提出的判定问题，并在其后尝试定义有效计算性或者有效方法中成形。这些尝试包括库尔特·哥德尔、Jacques Herbrand和斯蒂芬·科尔·克莱尼分别于1930年、1934年和1935年提出的递归函数，阿隆佐·邱奇于1936年提出的λ演算，1936年Emil Leon Post的Formulation 1和艾伦·图灵1937年提出的图灵机。即使在当前，依然常有直觉想法难以定义为形式化算法的情况。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 130, 130, 'und', 0, '<p>传输是一个汉语词语，意义为传递，输送。在电信业中，传输是一种传输电学消息（连带经过媒介的辐射能现象）的行为。消息可以是一串或者一组数据单元，比如二进制数字，通常也称为帧或者块。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 131, 131, 'und', 0, '<p>在photoshop中，在不同的图像模式下，通道是不一样的。通道层中的像素颜色是由一组原色的亮度值组成的，通道实际上可以理解为是选择区域的映射。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 132, 132, 'und', 0, '<p>设计是把一种设想通过合理的规划、周密的计划、通过各种方式表达出来的过程。人类通过劳动改造世界，创造文明，创造物质财富和精神财富，而最基础、最主要的创造活动是造物。设计便是造物活动进行预先的计划，可以把任何造物活动的计划技术和计划过程理解为设计。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 133, 133, 'und', 0, '<p>进行，词语。有以下几个含义：①从事（某种活动）：～讨论ㄧ～工作ㄧ～教育和批评 ㄧ会议正在～。‘进行’总是用在持续性的和正式、严肃的行为，短暂性的和日常生活中的行为不用‘进行’，例如不说 ‘进行午睡 ’，‘进行叫喊 ’。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 134, 134, 'und', 0, '<p>数据（data）是事实或观察的结果，是对客观事物的逻辑归纳，是用于表示客观事物的未经加工的原始素材。数据可以是连续的值，比如声音、图像，称为模拟数据；也可以是离散的，如符号、文字，称为数字数据。在计算机系统中，数据以二进制信息单元0、1的形式表示。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 135, 135, 'und', 0, '<p>集成电路英语：integrated circuit，缩写作 IC；或称微电路（microcircuit）、微芯片（microchip）、晶片/芯片（chip）在电子学中是一种将电路（主要包括半导体设备，也包括被动组件等）小型化的方式，并时常制造在半导体晶圆表面上。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 136, 136, 'und', 0, '<p>提出，汉语词语，拼音是，意思是指揭示；提请考虑、讨论、接受或采纳。[1]</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 137, 137, 'und', 0, '<p>\"端口\"是英文port的意译，可以认为是设备与外界通讯交流的出口。端口可分为虚拟端口和物理端口，其中虚拟端口指计算机内部或交换机路由器内的端口，不可见。例如计算机中的80端口、21端口、23端口等。物理端口又称为接口，是可见端口，计算机背板的RJ45网口，交换机路由器集线器等RJ45端口。电话使用RJ11插口也属于物理端口的范畴。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 138, 138, 'und', 0, '<p>《问题》（英文名为：Emerson）是美国爱默生在1998年创作的诗歌。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 139, 139, 'und', 0, '<p>提高，读音是tí gāo，汉语词语，意思是使原来位置、程度、等级、数量、水准等方面加以增高、拉升。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 140, 140, 'und', 0, '<p>方向，男，汉族，1957年10月生，浙江淳安人，中国共产党党员，中国人民解放军中将军衔。现任中国人民解放军军事科学院政治委员。[1]</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 141, 141, 'und', 0, '<p>路径（path）在不同的领域有不同的含义。在网络中，路径指的是从起点到终点的全程路由；在日常生活中指的是道路。路径在Photoshop中是使用贝赛尔曲线所构成的一段闭合或者开放的曲线段。UNISURF，并于1972年在该公司应用。贝赛尔的方法将函数无穷逼近同集合表示结合起来，使得设计师在计算机上绘制曲线就象使用常规作图工具一样得心应手。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 143, 143, 'und', 0, '<p>一是指词语，表示知道的意思，二是指通信的通道，是信号传输的媒介。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 144, 144, 'und', 0, '<p>接入方式，从接入业务的角度看，可简单地分为适用于窄带业务的接入网技术和适用于宽带业务的接入网技术。从用户入网方式角度来看，Internet接入技术可以分为有线接入和无线接入两大类。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 145, 145, 'und', 0, '<p>《再见，在也不见》是由忻钰坤、陈世杰、西瓦罗·孔萨库联合执导，陈柏霖、蒋雯丽、秦沛、杨佑宁等联合主演的爱情电影。该片以人与人之间的地理、心灵和感情的距离为背景，讲述了三个发生在不同地域又互有关联，关于亲情、友情、爱情的故事[1]。影片于2015年11月5日作为金马影展开幕影片首映，2016年5月13日在中国大陆上映[2]。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 146, 146, 'und', 0, '<p>信息，指音讯、消息、通讯系统传输和处理的对象，泛指人类社会传播的一切内容。人通过获得、识别自然界和社会的不同信息来区别不同事物，得以认识和改造世界。在一切通讯和控制系统中，信息是一种普遍联系的形式。1948年，数学家香农在题为“通讯的数学理论”的论文中指出：“信息是用来消除随机不定性的东西”。创建一切宇宙万物的最基本单位是信息。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 147, 147, 'und', 0, '<p>频谱是频率谱密度的简称，是频率的分布曲线。复杂振荡分解为振幅不同和频率不同的谐振荡，这些谐振荡的幅值按频率排列的图形叫做频谱。频谱广泛应用于声学、光学和无线电技术等方面。频谱将对信号的研究从时域引入到频域，从而带来更直观的认识。把复杂的机械振动分解成的频谱称为机械振动谱，把声振动分解成的频谱称为声谱，把光振动分解成的频谱称为光谱，把电磁振动分解成的频谱称为电磁波谱，一般常把光谱包括在电磁波谱的范围之内。分析各种振动的频谱就能了解该复杂振动的许多基本性质，因此频谱分析已经成为分析各种复杂振动的一项基本方法。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 148, 148, 'und', 0, '<p>网络是由若干节点和连接这些节点的链路构成，表示诸多对象及其相互联系。在1999年之前，人们一般认为网络的结构都是随机的。但随着Barabasi和Watts在1999年分别发现了网络的无标度和小世界特性并分别在世界著名的《科学》和《自然》杂志上发表了他们的发现之后，人们才认识到网络的复杂性。[1]网络会借助文字阅读、图片查看、影音播放、下载传输、游戏、聊天等软件工具从文字、图片、声音、视频等方面给人们带来极其丰富的生活和美好的享受。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 149, 149, 'und', 0, '<p>“业务”更白话一些来说，就是各行业中需要处理的事务，但通常偏向指销售的事务，因为任何公司单位最终仍然是以销售产品、销售服务、销售技术等等为主。“业务”最终的目的是“售出产品，换取利润”。所以通常会把业务员等于销售员，也就是这个原因，业务就是进行或处理商业上相关的活动。业务也是渠道就是指产家与销点之间关系是通过渠道之间建立起来的。而业务员在这中间起了重大的作用。业务员的工作直接影响到产家、销点、消费者这三者之间的关系。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 150, 150, 'und', 0, '<p>因子，基本含义为“元素、因素、成分”，出自孙中山 《实业计划》：“一切人类智识，以印刷蓄积之，故此为文明一大因子。”</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 151, 151, 'und', 0, '<p>统计一词起源于国情调查，最早意为国情学。一般来说，统计包括三个含义：统计工作、统计资料和统计科学。统计工作、统计资料、统计科学三者之间的关系是：统计工作的成果是统计资料，统计资料和统计科学的基础是统计工作，统计科学既是统计工作经验的理论概括，又是指导统计工作的原理、原则和方法。原始的统计工作即人们收集数据的原始形态已经有几千年的历史，而它作为一门科学，是从17世纪开始。英语中统计学家和统计员是同一个单词，但统计学并不是直接产生于统计工作的经验总结。每一门科学都有其建立、发展和客观条件，统计科学则是统计工作经验、社会经济理论、计量经济方法融合、提炼、发展而来的一种边缘性学科。[1]</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 152, 152, 'und', 0, '<p>建立是一个动词，读音为Jiàn Lì，顾名思义让某种事物从无到有的一个过程。有开始成立，产生。设置，设立，兴建，建设等的含义在内。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 153, 153, 'und', 0, '<p>公平是一个社会学名词，在法律上，公平是法所追求的基本价值之一。公是公共，指大家，平是指平等，意指为大家平等存在。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 154, 154, 'und', 0, '<p>《问题》（英文名为：Emerson）是美国爱默生在1998年创作的诗歌。</p>\r\n<a href=\"baidu\">baidu</a>', '', 'filtered_html'),
('node', 'annotation', 0, 155, 155, 'und', 0, '<p>世界知识产权组织在1977年版的《供发展中国家使用的许可证贸易手册》中，给技术下的定义：“技术是制造一种产品的系统知识，所采用的一种工艺或提供的一项服务，不论这种知识是否反映在一项发明、一项外形设计、一项实用新型或者一种植物新品种，或者反映在技术情报或技能中，或者反映在专家为设计、安装、开办或维修一个工厂或为管理一个工商业企业或其活动而提供的服务或协助等方面。”这是至今为止国际上给技术所下的最为全面和完整的定义。知识产权组织把世界上所有能带来经济效益的科学知识都定义为技术。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 156, 156, 'und', 0, '<p>研究，读音，汉语词语，意思是主动寻求根本性原因与更高可靠性依据，从而为提高事业或功利的可靠性和稳健性而做的工作。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 157, 157, 'und', 0, '<p>资源，指一国或一定地区内拥有的物力、财力、人力等各种物质要素的总称。资源，可分为自然资源和社会资源两大类。前者如阳光、空气、水、土地、森林、草原、动物、矿藏等；后者包括人力资源、信息资源以及经过劳动创造的各种物质财富等。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 158, 158, 'und', 0, '<p>曲线，是微分几何学研究的主要对象之一。直观上，曲线可看成空间质点运动的轨迹。微分几何就是利用微积分来研究几何的学科。为了能够应用微积分的知识，我们不能考虑一切曲线，甚至不能考虑连续曲线，因为连续不一定可微。这就要我们考虑可微曲线。但是可微曲线也是不太好的，因为可能存在某些曲线，在某点切线的方向不是确定的，这就使得我们无法从切线开始入手，这就需要我们来研究导数处处不为零的这一类曲线，我们称它们为正则曲线。正则曲线才是经典曲线论的主要研究对象。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 159, 159, 'und', 0, '<p>在通信领域中，信号是表示消息的物理量，如电信号可以通过幅度、频率、相位的变化来表示不同的消息。干扰是指对有用信号的接收造成损伤。干扰一般由以下两种，串扰：电子学上两条信号线之间的耦合现象。无线电干扰：通过发送无线电信号来降低信噪比的方式，达到破坏通信、阻止广播电台信号的行为。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 160, 160, 'und', 0, '<p>特性，读音为tè xìng，汉语词汇，意思是指某事物所特有的性质，出自《孙中山逝世与国民革命》。</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 161, 161, 'und', 0, '<p>策略游戏。这类游戏提供给玩家一个可以多动脑筋思考问题，处理较复杂事情的环境，允许玩家自由控制、管理和使用游戏中的人、或事物，通过这种自由的手段以及玩家们开动脑筋想出的对抗敌人的办法来达到游戏所要求的目标。[1]</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 164, 164, 'und', 0, '<p>xxxxxxxxxxxxxxxxxxxxxx</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 165, 165, 'und', 0, '<p>yyyyyyyyyyyyyyyyyyyyyy</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 166, 166, 'und', 0, '<p>zzzzzzzzzzzzzzzzzzzzzz</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 168, 168, 'und', 0, '<p>uuuuuuu</p>\n', NULL, 'filtered_html'),
('node', 'annotation', 0, 169, 169, 'und', 0, '<p>vvvvv</p>\n', NULL, 'filtered_html');
